import React, { useState } from "react";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import TurnedInNotIcon from '@mui/icons-material/TurnedInNot';
import BookmarkIcon from '@mui/icons-material/Bookmark';


function Home(props) {

    const [clicked, setClicked] = useState(false)
    const handleIconClick = (id) => {
        return setClicked(true)
    }

    return (
        <div>
            {/* <div className="term">
                 <span className="emoji" role="img" aria-label="Tense Biceps">
                     {props.image}
                 </span>
                 <dt>
                     <span>{props.name}</span>
                 </dt>
                <dd>{props.category}</dd>
                 <dd>{props.bookmark}</dd>
              <dd>{props.rating}</dd>  */}





            <div>
                <Card sx={{ maxWidth: 345 }}>
                    <CardMedia
                        component="img"
                        alt="green iguana"
                        height="140"
                        image={props.image}
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            {props.name}
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                            {props.category}
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">{props.rating}</Button>
                        {/* <Button button onClick={handleIconClick(101)}>
                            {clicked ? <TurnedInNotIcon /> : <BookmarkIcon />}
                        </Button> */}
                        <IconButton onClick={() => setClicked(true)}>
                            {clicked ? <BlockIcon /> : <AddCircleIcon />}
                        </IconButton>
                    </CardActions>
                </Card>
            </div>
        </div>
    );
}


export default Home;
